import React from "react";
import { Col } from "react-bootstrap";
import "../../style.css";
import "bootstrap/dist/css/bootstrap.min.css";
import myImg from "../../Assets/figure.png";
import IMG_1 from "../../Assets/9.svg";
import IMG_2 from "../../Assets/3.svg";

function Techstack(prop) {
  return (
    <div>
      <Col xs={4} md={2} >
        <div class="wrapper1">
          <div class="container1" id="c01">
          <img src={prop.iconName} className="img-fluid" alt="avatar" />
          {/* <i className={`${prop.iconName} tech-icon-images`}></i> */}
          </div>
          </div>
      </Col>

    </div>
  );
}

export default Techstack;
